import React from 'react';
import Footer from '../../ReusableComponents/Footer/Footer';
import Header from '../../ReusableComponents/Header';
import FirstSection from './FirstSection/FirstSection'

const Checkout = () => {
    return (
        <div>
            <Header/>
            <FirstSection/>
            <Footer/>
        </div>
    );
};

export default Checkout;
